import React from 'react';

const genres = [
    {
        name: 'Pop',
        bgc: 'rgb(20, 138, 8)',
        imgUrl: 'https://i.scdn.co/image/ab67fb8200005cafa862ab80dd85682b37c4e768'
    },
    {
        name: 'Hip-Hop',
        bgc: 'rgb(188, 89, 0)',
        imgUrl: 'https://i.scdn.co/image/ab67fb8200005caf7e11c8413dc33c00740579c1'
    },
    // ... (other genres)
];

export function GenreList() {
    return (
        <ul className="genre-list">
            {genres.map(genre => (
                <li key={genre.name} className="genre-preview" style={{ backgroundColor: genre.bgc }}>
                    <img src={genre.imgUrl} alt="" />
                    <h2>{genre.name}</h2>
                </li>
            ))}
        </ul>
    );
}
